rule-providers:
  cnip:
    behavior: ipcidr
    format: mrs
    interval: 86400
    type: http
    url: https://raw.githubusercontent.com/DustinWin/ruleset_geodata/mihomo-ruleset/cnip.mrs
  privateip:
    behavior: ipcidr
    format: mrs
    interval: 86400
    type: http
    url: https://raw.githubusercontent.com/DustinWin/ruleset_geodata/mihomo-ruleset/privateip.mrs
  ads:
    behavior: domain
    format: mrs
    interval: 86400
    type: http
    url: https://raw.githubusercontent.com/DustinWin/ruleset_geodata/mihomo-ruleset/ads.mrs
  ai:
    behavior: domain
    format: mrs
    interval: 86400
    type: http
    url: https://raw.githubusercontent.com/DustinWin/ruleset_geodata/mihomo-ruleset/ai.mrs
  cn:
    behavior: domain
    format: mrs
    interval: 86400
    type: http
    url: https://raw.githubusercontent.com/hopub/meta-rules-dat/meta/geo/geosite/cn.mrs
  fakeip-filter:
    behavior: domain
    format: mrs
    interval: 86400
    type: http
    url: https://raw.githubusercontent.com/DustinWin/ruleset_geodata/mihomo-ruleset/fakeip-filter.mrs
  proxy:
    behavior: domain
    format: mrs
    interval: 86400
    type: http
    url: https://raw.githubusercontent.com/hopub/meta-rules-dat/meta/geo/geosite/gfw-proxy.mrs
  google:
    behavior: domain
    format: mrs
    interval: 86400
    type: http
    url: https://raw.githubusercontent.com/MetaCubeX/meta-rules-dat/meta/geo/geosite/google.mrs
  private:
    behavior: domain
    format: mrs
    interval: 86400
    type: http
    url: https://raw.githubusercontent.com/DustinWin/ruleset_geodata/mihomo-ruleset/private.mrs
  tracker:
    behavior: domain
    format: mrs
    interval: 86400
    type: http
    url: https://raw.githubusercontent.com/MetaCubeX/meta-rules-dat/meta/geo/geosite/tracker.mrs
rules:
- RULE-SET,private,DIRECT
- RULE-SET,ads,全球拦截
- RULE-SET,tracker,DIRECT
- RULE-SET,google,谷歌服务
- RULE-SET,ai,人工智能
- RULE-SET,proxy,代理
- RULE-SET,cn,DIRECT
- RULE-SET,privateip,DIRECT,no-resolve
- RULE-SET,cnip,DIRECT,no-resolve
- MATCH,漏网之鱼
sniffer:
  enable: true
  force-dns-mapping: true
  override-destination: false
  parse-pure-ip: true
  skip-domain:
  - +.push.apple.com
  sniff:
    HTTP:
      ports:
      - 80
      - 8080-8880
      override-destination: true
    TLS:
      ports:
      - 443
      - 8443
    QUIC:
      ports:
      - 443
      - 8443
socks-port: 1080
tcp-concurrent: true
tun:
  auto-detect-interface: true
  auto-redirect: true
  auto-route: true
  enable: true
  dns-hijack:
  - any:53
  - tcp://any:53
  stack: mixed
  strict-route: true
unified-delay: true
